package fonts

import "encoding/base64"

// The Open Sans font encoded here is subject to the Apache License 2.0
// https://www.apache.org/licenses/LICENSE-2.0.html

const openSansLightTTFBase64 = ""

var openSansLight []byte

func OpenSansLightBytes() []byte {
	if len(openSansLight) == 0 {
		var err error
		openSansLight, err = base64.StdEncoding.DecodeString(openSansLightTTFBase64)
		if err != nil {
			panic(err)
		}
	}

	return openSansLight
}
